import './MyProfile.css';

const MyProfile = () =>{

    findCurrentEmail = (id,users) => {
        let email;
        users.forEach(user => {
            if(user.id == id) {
                email = user.email;
            }
        })

        return email;
    }

      const {users} = this.props;

    return (
      <div className='MyProfile'>
          <h2>My Profile</h2>
          <span>Email - {this.findCurrentEmail(id,users)}</span>
      </div>
    )
  }

export default MyProfile;
